import React, { Component } from 'react';



class Thirdblog extends Component {
  render() {
    return (

      <div className="main">
      <h1>
      This is the 3rd page
      </h1>

      <img src="https://www.worldatlas.com/r/w728-h425-c728x425/upload/3e/cb/41/brussels.jpg" alt="Belgium">
      </img>



      <p>
      I'm gonna be adding the 3rd blog page here. probs gonna be some lit ass content but depending on how much time i have left it may suck lol.
      </p>
      </div>

    );
  }
}

export default Thirdblog;
